                // Aggiorna Segnale Live

                // Calcolo Backtest Dinamico
                let capital = 20000; let curve = []; let days = [];
                rawData.forEach(day => {
                    let side = 0;

                    capital += (side * day.p);
                    curve.push(capital);
                    days.push(day.d);
                });
